import React from 'react'
import "./liblist.css";


function liblist() {
  const url = "https://jsonplaceholder.typicode.com/users";
  const [data, setData] = useState([]);

  const fetchInfo = () => {
    return fetch(url)
      .then((res) => res.json())
      .then((d) => setData(d))
  }


  useEffect(() => {
    fetchInfo();
  }, []);
  return (

    <div>
      <h1>in this page i will print all the available liibraries</h1>
    </div>
  )
}
export default liblist
